const NavBar2 = () => {
    return (
        <main>
        <nav>
            <div id="logo">InternshipReport</div>

            <label for="drop" class="toggle">Menu</label>
            <input type="checkbox" id="drop" />
                <ul class="menu">
                    <li><Link to='/InternshipReport'>Remerciements</Link></li>
                    <li><Link to='/InternshipReport'>Plan</Link></li>
                    <li><Link to='/InternshipReport'>Introduction</Link></li>
                    <li><Link to='/InternshipReport'>Développement</Link></li>
                    <li>
                        <Link to='/InternshipReport'>Teams</Link>
                        <ul>
                            <li><Link to='/InternshipReport'>Datamining</Link></li>
                            <li><Link to='/InternshipReport'>Tutorials</Link></li>
                        </ul> 

                    </li>
                    <li><Link to='/InternshipReport'>Conclusion</Link></li>
                </ul>
            </nav>
        </main>
    )
}



export default NavBar2
